package com.synatx.class7;

public class Nestedloopdemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		// print 9999
		
		for(int i=0; i<=9; i++) {
			
			for(int j=0; j<=9; j++) {
				
				for(int k=0; k<=9; k++) {
					
					for(int l=0; l<=9; l++) {
						System.out.println(i+" "+j+" "+k+" "+l);
					}
				}
				
			
			}
		}

	}

}
